 private CDOStateMachine(){  init(CDOState.CONFLICT, CDOEvent.DETACH_REMOTE, IGNORE); init(CDOState.CONFLICT, CDOEvent.RELOAD, FAIL);  init(CDOState.CONFLICT, CDOEvent.COMMIT, IGNORE);  init(CDOState.CONFLICT, CDOEvent.ROLLBACK, new RollbackTransition(CDOState.PROXY));  init(CDOState.INVALID, CDOEvent.PREPARE, InvalidTransition.INSTANCE);  init(CDOState.INVALID, CDOEvent.ATTACH, InvalidTransition.INSTANCE); } 
